import { IAssetsGroup } from "./IAssetsGroup";
/**
 * interface for data to load assets by theirs priority
 * we have 3 priority groups: preload, initial, lazy
 */
export interface IAssetsToLoad {
    groups: {
        general: IAssetsGroup[];
        initial: IAssetsGroup[];
        preload: IAssetsGroup[];
        lazy: IAssetsGroup[];
    };
}
